using SeedApi;

var client = new SeedApiClient();
await client.User.CreateUserAsync(
    new CreateUserRequest
    {
        Username = "string",
        Email = "string",
        Age = 1,
        Weight = 1.1f,
    }
);

using SeedApi;

var client = new SeedApiClient();
await client.User.GetUserAsync(
    new GetUserRequest
    {
        Username = "string",
        Age = 1,
        Weight = 1.1f,
    }
);
